import React from 'react';
import Apresentacao from './Apresentacao';
import ProjetosLista from './ProjetosLista'; // Corrige o nome do componente, se necessário

export default function ProjetosPortifolio() {
    return (
        <main
            style={{
                backgroundImage: `url('../../img/background-projects.png')`,
                backgroundRepeat: 'no-repeat',
                backgroundSize: 'cover',
            }}
        >
            <Apresentacao />
            <ProjetosLista />
        </main>
    );
}
